import React from 'react';
import Axios from 'axios';
import $ from 'jquery';
import DataTable from 'datatables.net-dt';

$.DataTable = DataTable;

export const Modal = (isOpen, close) => {
   
    return (
        <React.Fragment>
            {
                isOpen ?
                    <React.Fragment>
                        <div className="history_table">
                            <h2>All Event History</h2>
                            <table id="dataTable_history" className="">
                                <thead>
                                <tr>
                                    <th>DATE</th>
                                    <th>EVENT</th>
                                    <th>LOG</th>
                                </tr>
                                </thead>
                            </table>
                        </div>
                    </React.Fragment>
                    :
                    null
            }
        </React.Fragment>
    )
};
